import React from "react";
import classes from "./Dialogs.module.css";

function Dialogs() {
  return (
    <div>
      <div className={classes.dialogs}>
        <div className={classes.dialogsItems}>
          <div className={classes.dialog + "" + classes.active}>Jimmy</div>
          <div className={classes.dialog}>Bobby</div>
          <div className={classes.dialog}>Tommy</div>
          <div className={classes.dialog}>Katrine</div>
          <div className={classes.dialog}>Victoria</div>
        </div>
        <div className={classes.messages}>
          <div className={classes.message}>Hi</div>
          <div className={classes.message}>Good</div>
          <div className={classes.message}>Nice</div>
        </div>
      </div>
    </div>
  );
}
export default Dialogs;
